(96, 'SHOES', 'shoes', 'Keep your feet sweet in everything from killer heels, effortlessly chic slip ons and those must-have flats for everyday. Wondering what shoes to pair with that new outfit? Haute Signatures has your back with our versatile collection of women’s shoes to cover all fashion moments. We have all the styles and shoes online to suit any vibe, whatever your plans. Need leopard print shoes or flat suede shoes for work? Sorted! From slip on shoes for all occasions to silver/gold shoes for party season, we’ve got you covered. For all the women\'s footwear you could ever dream of, take a scroll (your feet will thank us later).', 'https://hautesignatures.com/images/category/Oo2DIIo7iuYz0DEVBGdm6xhAK4jve1Xrt3KFc6o5.jpeg', NULL, '2020-10-19 16:00:05', '2020-12-15 20:31:43', 2, 'https://hautesignatures.com/products/shoes?colors[]=white', NULL, 0, NULL),
