ze:10pt\"><span style=\"color:#434343\">Haute Signatures Platforms offer many ways to find, enjoy, and share content.</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">Trademarks, logos and service marks displayed on this site are registered and unregistered trademarks of Haute Signatures. Their licensors or content providers, or other third parties. All of these trademarks, logos and service marks are the property of their respective owners. Nothing on this site shall be construed as granting, by implication, estoppel, or otherwise, any license or right to use any trademark, logo or service mark displayed on the site without the owner&rsquo;s prior written permission, except as otherwise described herein. Haute Signatures reserves all rights not expressly granted in and to the site and its content. This site and all of its content, including but not limited to text, design, graphics, interfaces and code, and the selection and arrangement thereof, is protected under the copyright laws of Nigeria and other countries.</span></span></p>\r\n\r\n<h2><span style=\"font-size:13.999999999999998pt\"><span style=\"color:#434343\">Infringement Notice</span></span></h2>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">We respect the intellectual property rights of others and request that you do the same. If you think your work has been copied in a manner that constitutes copyright infringement, you may notify us by emailing info@hautesignatures.com</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">In order for us to more effectively assist you, the notification must include ALL of the following:</span></span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><span style=\"color:#434343\">A physical or electronic signature of the copyright owner or the person authorized to act on the owners behalf; a description of the copyrighted work you claim has been infringed; information reasonab